import React, { Component } from "react";
import Card from "./Card";
export default class RowOfCards extends Component {
  state = {};
  componentDidMount = () => {};
  getCards = () => {
    this.props.cards.map((card) => <Card val>{card.value}</Card>);
  };
  render() {
    return <div>{this.getCards()}</div>;
  }
}
